class Navigation extends React.Component {
    render() {
        return (
            <Navbar bg="white">
                <Container>
                    <Navbar.Brand href="#"></Navbar.Brand>
                    <Navbar.Collapse className="justify-content-md-end">
                        <Nav className="d-none d-md-flex">
                            <Nav.Link href="https://www.develop.realtystore.com/Membersite/?from=banner">
                                <i class="fa fa-user"></i> Member Sign-in
                            </Nav.Link>
                        </Nav>
                        <Nav className="d-md-none">
                            <span class="d-inline d-md-none mobile-h1 text-primary w-100 text-left"><span class="d-inline d-md-none">0 matching listings</span></span>
